import { createStore } from 'redux'
import reducer from './../reducer'
//import { composeWithDevTools } from 'redux-devtools-extension';

const initialState = {
  studentID: '' ,
  studentPassword: '' ,
  studentMajor: '' ,
};

export default () => createStore(reducer,nitialState)
